"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Adrenal crisis (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/adrenal-crisis-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H1671090105\">",
"      <span class=\"h1\">",
"       What is adrenal crisis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Adrenal crisis is a serious medical problem that can cause you to pass out and even lead to death. It happens when your adrenal glands are not working right. The adrenal glands are a pair of organs that are located on top of the kidneys (",
"      <a class=\"graphic graphic_figure graphicRef67279 \" href=\"UTD.htm?26/50/27424\">",
"       figure 1",
"      </a>",
"      ). These glands make a lot of different hormones, including 2 hormones that are very important for normal body function:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Aldosterone &ndash; This hormone helps control the amount of salt and fluid in the body.",
"       </li>",
"       <li>",
"        Cortisol &ndash; This hormone helps control how the body uses sugar and how it responds to stress.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Adrenal crisis happens when the adrenal glands do not release enough of 1 or both of these hormones. If you do not have enough of these hormones, your body can go into shock. That is when your blood pressure drops to a dangerously low level and you pass out. Adrenal crisis is a medical emergency.",
"     </p>",
"     <p>",
"      <strong>",
"       What are the symptoms of adrenal crisis?",
"      </strong>",
"      &ndash; Adrenal crisis usually comes on suddenly. The symptoms can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Vomiting",
"       </li>",
"       <li>",
"        Belly pain",
"       </li>",
"       <li>",
"        Weakness",
"       </li>",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Confusion",
"       </li>",
"       <li>",
"        Passing out",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1671090137\">",
"      <span class=\"h1\">",
"       What causes adrenal crisis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Adrenal crisis usually happens in people who already have a medical condition that affects the adrenal glands. For example, it can happen in people who have Addison&rsquo;s disease (also called &ldquo;adrenal insufficiency&rdquo;) or congenital adrenal hyperplasia (also called &ldquo;CAH&rdquo;).",
"     </p>",
"     <p>",
"      People who have these adrenal problems must take hormones to replace the hormones they lack. But if they get sick, get into an accident, or have surgery, the hormones they normally take are not always enough. That&rsquo;s why people with adrenal problems sometimes have to take extra medicine when they are sick or when they know they are going to have surgery.",
"     </p>",
"     <p>",
"      Adrenal crisis can also happen in people who take medicines called steroids at high doses for a long time and suddenly stop taking them. Plus it can happen in people who have bleeding in their adrenal glands because of infection or severe injury, or because they were taking blood thinners.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1671090152\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes, if you have symptoms of adrenal crisis, call 9-1-1 for an ambulance. This is especially important if you already know that you have a medical condition that affects your adrenal glands (such as Addison&rsquo;s disease).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1671090167\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If your doctor or nurse suspects you have adrenal crisis, he or she will order blood tests to check your blood sugar and hormone levels.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1671090182\">",
"      <span class=\"h1\">",
"       How is adrenal crisis treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment is done at the hospital and involves getting 2 things though a tube in a vein (called an IV):",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Fluids with salt and sugar to replace what has been lost",
"       </li>",
"       <li>",
"        Hormone medicines to replace the hormones that are missing",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Once doctors have treated the crisis, they will try to find out what caused the crisis in the first place. For example, they will check for infection or for signs of adrenal gland problems.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1671090197\">",
"      <span class=\"h1\">",
"       Can adrenal crisis be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If you have a medical condition that keeps your adrenal glands from making enough hormones, your doctor will give you hormone medicines to replace what is missing. These medicines can reduce the chances you will have adrenal crisis again.",
"     </p>",
"     <p>",
"      People usually need to take these medicines every day for the rest of their life.",
"     </p>",
"     <p>",
"      It is important to let your doctor or nurse know if you have any side effects from the medicines or develop any new symptoms.",
"     </p>",
"     <p>",
"      Your doctor might also prescribe emergency medicine that you should keep with you at all times in case you have adrenal crisis again. This medicine comes in the form of a shot. If you think you are having adrenal crisis, use this medicine and then call 9-1-1 for an ambulance.",
"     </p>",
"     <p>",
"      Your doctor might recommend that you also use this emergency medicine if you:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Get very sick with a high fever",
"       </li>",
"       <li>",
"        Have a major injury, for example if you break a bone or lose a lot of blood",
"       </li>",
"       <li>",
"        Pass out",
"       </li>",
"       <li>",
"        Vomit up your daily medicine",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1671090212\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?20/26/20898?source=see_link\">",
