var content_f11_19_11572=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F67197&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F67197&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 546px\">",
"   <div class=\"ttl\">",
"    Congenital cervical dysgenesis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 526px; height: 547px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The cervical body is intact (A) with obstruction of the cervical os. The cervical body (B) consists of a fibrous band of variable diameter that may contain endocervical glands. Fragmented portions of the cervix are noted (C) with no connection to the uterine body. Hypoplasia of the uterine cavity may be associated with cervical cords or fragmentation. The midportion of the cervix (D) is hypoplastic with a bulbous tip. No cervical lumen is identified.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn with permission from: Rock, JA, Carpenter, SE, Wheeless, CR, Jones, Jr., HW. The clinical management of maldevelopment of the uterine cervix. Journal of Pelvic Surgery 1995; 1:129.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
