"   <div class=\"block dos drugH1Div\" id=\"F1056768\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Usual",
"    </span>",
"    <p>",
"     (For additional information",
"     <a class=\"drug drug_general\" href=\"UTD.htm?6/7/6264?source=see_link\">",
"      see \"Benzocaine: Drug information\"",
"     </a>",
"     )",
"    </p>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Children and Adults:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Mucous membranes: Dosage varies depending on area to be anesthetized and vascularity of tissues",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Oral mouth/throat preparations: Do not administer for &gt;2 days or in children &lt;2 years of age, unless directed by a physician; refer to specific package labeling",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Otic: 4-5 drops into ear canal; may repeat every 1-2 hours as needed",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Topical: Apply to affected area as needed",
"    </p>",
"   </div>",
