" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Carbamazepine poisoning",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?11/19/11577/contributors\">",
"     Authors",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?11/19/11577/contributors\">",
"     Spencer Greene, MD, MS, FACEP",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?11/19/11577/contributors\">",
"     Ayrn O'Connor, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?11/19/11577/contributors\">",
"     Section Editors",
