var title_f11_19_11579="Components of second and third trimester ultrasound examinations";
var content_f11_19_11579=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F63045&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F63045&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Components of second and third trimester ultrasound examinations",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Presence or absence of fetal cardiac activity, cardiac rate and rhythm",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fetal number",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fetal presentation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Assessment of amniotic fluid volume",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Placental appearance and location",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fetal biometry (biparietal diameter and/or head circumference, femoral length, abdominal diameter and/or circumference)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Evaluation of the uterus, cervix, adnexa when clinically appropriate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fetal anatomic survey",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Biometry can be used to estimate gestational age (if not previously determined), fetal weight, and fetal growth (by comparing two or more examinations over an appropriate time interval).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
