var title_f11_19_11581="Driver's with pacemakers";
var content_f11_19_11581=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F79800&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F79800&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommendations for certification for commercial drivers with pacemakers",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Diagnosis",
"       </td>",
"       <td class=\"subtitle1\">",
"        Physiologic/functional",
"       </td>",
"       <td class=\"subtitle1\">",
"        Certification",
"       </td>",
"       <td class=\"subtitle1\">",
"        Re-certification",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"5\">",
"        Sinus node dysfunction",
"       </td>",
"       <td rowspan=\"5\">",
"        Variable long-term prognosis depending on underlying disease, but cerebral hypoperfusion corrected by support of heart rate by pacemaker",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Yes if:",
"       </td>",
"       <td rowspan=\"4\">",
"        <p>",
"         Annual",
"        </p>",
"        <p>",
"         Documented pacemaker checks",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - 1 month after pacemaker implantation and",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Documented correct function by pacemaker center and",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Underlying disease is not disqualifying",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"5\">",
"        Atrioventricular (AV) block",
"       </td>",
"       <td rowspan=\"5\">",
"        Variable long-term prognosis depending on underlying disease, but cerebral hypoperfusion corrected by support of heart rate by pacemaker",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Yes if:",
"       </td>",
"       <td rowspan=\"4\">",
"        <p>",
"         Annual",
"        </p>",
"        <p>",
"         Documented pacemaker checks",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - 1 month after pacemaker implantation and",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Documented correct function by pacemaker center and",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Underlying disease is not disqualifying",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"5\">",
"        Neurocardiogenic syncope",
"       </td>",
"       <td rowspan=\"5\">",
"        <p>",
"         Excellent long-term survival prognosis but there is risk for syncope that may be due to cardioinhibitory (slowing heart rate) or vasodepressor (drop in blood pressure) components, or both",
"        </p>",
"        <p>",
"         Pacemaker will affect only cardioinhibitory component, but will lessen effect of vasodepressor component",
"        </p>",
"       </td>",
"       <td>",
"        No, with symptoms",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Yes if:",
"       </td>",
"       <td rowspan=\"4\">",
"        <p>",
"         Annual",
"        </p>",
"        <p>",
"         Documented pacemaker checks",
"        </p>",
"        <p>",
"         Absence of symptom recurrence",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - 3 months* after pacemaker implantation and",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Documented correct function by pacemaker center and",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Absence of symptom recurrence",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"5\">",
"        Hypersensitive carotid sinus with syncope",
"       </td>",
"       <td rowspan=\"5\">",
"        <p>",
"         Excellent long-term survival prognosis but there is risk for syncope that may be due to cardioinhibitory (slowing heart rate) or vasodepressor (drop in blood pressure) components, or both",
"        </p>",
"        <p>",
"         Pacemaker will affect only cardioinhibitory component, but will lessen effect of vasodepressor component",
"        </p>",
"       </td>",
"       <td>",
"        No, with symptoms",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Yes if:",
"       </td>",
"       <td rowspan=\"4\">",
"        <p>",
"         Annual",
"        </p>",
"        <p>",
"         Documented regular pacemaker checks and",
"        </p>",
"        <p>",
"         Absence of symptom recurrence",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - 3 months* after pacemaker implantation and",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Documented correct function by pacemaker center and",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        - Absence of symptom recurrence",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Three months recommended due to possible vasodepressor component of syndrome not necessarily treated by pacing.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Blumenthal R, Braunstein J, Connolly H, et al. Cardiovascular Advisory Panel Guidelines for the Medical Examination of Commercial Motor Vehicle Drivers, October 2002. Federal Motor Carrier Safety Administration.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
